  \"2016-04-23T02:37:29.061651\",\n\t\"name\": \"national-flood-hazard-layer-nfhl-catalogued-with-database-name-emergencyflood-dfirm-in-vermonts\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Flood Hazard Layer (NFHL)
  data incorporates all Flood Insurance Rate Map (FIRM) databases published by the
  Federal Emergency Management Agency (FEMA), and any Letters of Map Revision (LOMRs)
  that have been issued against those databases since their publication date. It is
  updated on a monthly basis. The FIRM Database is the digital, geospatial version
  of the flood hazard information shown on the published paper FIRMs. The FIRM Database
  depicts flood risk information and supporting data used to develop the risk data.
  The primary risk classifications used are the 1-percent-annual-chance flood event,
  the 0.2-percent-annual-chance flood event, and areas of minimal flood risk. The
  FIRM Database is derived from Flood Insurance Studies (FISs), previously published
  FIRMs, flood hazard analyses performed in support of the FISs and FIRMs, and new
  mapping data, where available. The FISs and FIRMs are published by FEMA. The NFHL
  is available as State or US Territory data sets. Each State or Territory data set
  consists of all FIRM Databases and corresponding LOMRs available on the publication
  date of the data set. The specification for the horizontal control of FIRM Databases
  is consistent with those required for mapping at a scale of 1:12,000. This file
  is georeferenced to the Earth's surface using the Geographic Coordinate System (GCS)
  and North American Datum of 1983.\",\n\t\"license_title\": null,\n\t\"extras\":
